From IMDB: 

&quot;Convicted killer Laurence Dvorak grants an exclusive last interview to TV newswoman Alana Powers shortly before his scheduled execution. Urbane and unrepentant, he seems almost mild at first. But Dvorak's real intention is revealed when he takes Powers, her crew and two guards hostage, and demands that the television network broadcast an execution - live.&quot;

Bruce Davison
